public class InnerVirtualNodeTlsValidationContextFactory(Action<Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext>
{

    internal InnerVirtualNodeSubjectAlternativeNamesFactory SubjectAlternativeNamesFactory { get; set; }

    internal InnerVirtualNodeTlsValidationContextTrustFactory TrustFactory { get; set; }

    protected override Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext Create()
    {
        var tlsValidationContextResult = CreateTlsValidationContext();
        factoryAction?.Invoke(tlsValidationContextResult);

        return tlsValidationContextResult;
    }

    private Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext CreateTlsValidationContext()
    {
        var tlsValidationContextResult = new Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext();

        return tlsValidationContextResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.VirtualNodeTypes.TlsValidationContext result)
    {
        base.CreateChildren(result);

        result.SubjectAlternativeNames ??= SubjectAlternativeNamesFactory?.Build();
        result.Trust ??= TrustFactory?.Build();
    }

} // End Of Class

